INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Perferendis quo consequatur sed autem consequatur modi non similique.', 'Quia optio ullam repellendus expedita voluptatem. Omnis unde qui impedit totam voluptas. Ad aut et officia aspernatur qui laborum vero autem. Incidunt temporibus nihil ea et accusantium.', 'Voluptas voluptate neque dolorum accusantium dolor praesentium. Facere nobis earum voluptatibus nemo totam commodi aut animi. Architecto non optio vero maxime cupiditate repellendus at iste.', '1991-02-12');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Reprehenderit et natus iusto.', 'Nostrum doloribus et maxime dolor in recusandae. Dicta pariatur quis accusantium omnis. Et rerum aut harum optio dolores quibusdam at. Architecto autem laborum velit tenetur eos non.', 'Eum incidunt ad quo perferendis sint saepe aut. Maxime alias nisi dolorum et repellat in. Velit sint natus et consequuntur fugit minima tenetur. Laudantium exercitationem eum omnis quia.', '1995-11-21');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Est et porro voluptatem eum.', 'Officiis corporis excepturi laudantium a ratione. Ratione quis odit alias voluptate. Sint error fugiat sit.', 'Ad voluptatem ut ex. Odit aperiam sint aut beatae ab hic. Voluptatem beatae ut dolorem corporis laboriosam mollitia omnis. Corporis aliquam quos sed consequuntur reprehenderit voluptatum.', '1980-11-14');
